// alert('bb')
import "../stylesheets/application_nineod_freight.scss";

var jQuery = require('jquery')
global.$ = global.jQuery = jQuery;
window.$ = window.jQuery = jQuery;

// alert(global.$);

// window.jQuery = $;
// window.$ = $;
import AOS from 'aos';
document.addEventListener('DOMContentLoaded', function() {
  AOS.init({
    startEvent: 'turbolinks:load' // if you are using turbolinks
  });
});
alert(AOS);
import "./nineod-freight/jquery.js";
import "./nineod-freight/aos.js";
import "./nineod-freight/bootstrap.min.js";
import "./nineod-freight/custom.js";
